Genre:  Indie
Developer: Nival VR  
About the game: Year 2134. The humanity is standing upon the brink of a new era of modern healthcare. A surgical prototype assistant robot can shrink its operator to a microlevel and infiltrate the patient's body. The patient is suffering from the mild invasion of influenza virus. The goal is to outrun the virus and bring vaccine into the cell Nucleus. 


Minimum Requirements: 
OS: Windows 7/8/8.1/10 
Processor: Intel or AMD Dual-Core CPU with 2.8 GHz 
Memory: 4 GB RAM 
Graphics: No VR Mode: NVIDIA GeForce GTX 560 or AMD Radeon HD6900 | VR Mode: NVIDIA GeForce GTX 750 Ti or AMD Radeon R9 270 (FullHD resolution) 
DirectX: Version 11 
Hard Drive: 1500 MB available space 

How to install: 
1. Mount with Daemon Tools or burn iso.
2. Install the game!
3. Play and Enjoy!

